import { Card, Typography } from "@mui/material";
import { Box } from "@mui/system";

export const CartProduct = () => {
  return (
    <>
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        height="100vh"
        sx={{ backgroundColor: "grey" }}>

        <Card
          variant="outlined"
          sx={{
            maxWidth: "400px",
            height: "450px",
            p: 2,
            overflow: "visible",
            background: "#d0d0d0",
          }}>

<Box sx={{
                        display: 'flex',
                        flexDirection: 'column',
                        gap: 2,
                        p: 2,
                        color: 'blue',
                        
                    }}>
                        <Typography sx={{
                            fontWeight: '700',
                            textAlign: "center",
                            fontFamily: "arial",
                            fontSize: "20px",
                            marginBottom : "30px",
                        }}>
                            Your Shopping Cart
                        </Typography>
                    </Box>

          </Card>
      </Box>
    </>
  );
};
